import Vue from 'vue'
import VueRouter from 'vue-router'
import layout from '@/views/layout/Index.vue'
import login from '@/views/login/Index.vue'

Vue.use(VueRouter)

const routes = [
    {
        path: '/',
        component: layout,
    },
    {
        path: '/login',
        name: 'login',
        component: login,
    }
]

const router = new VueRouter({
    // mode: 'history',
    routes
})

export default router
